	EV.VERTRAG as CONTRACT,
	EV.ANLAGE as INSTALLATION,
	POD.EXT_UI as POD,
	EV.EINZDAT as MOVE_IN,
	EV.AUSZDAT as MOVE_OUT,
	EASTL.LOGIKNR as LOGICAL_DEVICE,
	EASTL.AB as DEVICE_START,
	EASTL.BIS as DEVICE_END,
	LTRIM(EGERR.GERAET,0) as METER_NO,
